import React from "react"

class TimeKeeper extends React.Component {
  constructor() {
    super()
    this.state = { time: 1 }
  }
  componentDidMount() {
    this.setState({ time: 2 })
  }
  componentDidUpdate() {
    let timer = 2
    setInterval(() => {
      this.setState({ time: timer })
    }, 100)
    timer++
    console.log(timer)
  }

  render() {
    return <div>TimeKepper</div>
  }
}

export default TimeKeeper
